//global router
const HOME = `/`;
const CONTACT = `/contact`;

//development router
const DEVELOPMENT = `/development`;
const NODEJS = `/nodejs`;
const MONGODB = `/mongoDb`;
const JAVASCRIPT = `/javaScript`;
const REACT = `/react`;

export const routers = {
  HOME,
  CONTACT,
  DEVELOPMENT,
  NODEJS,
  MONGODB,
  JAVASCRIPT,
  REACT,
};

